//Import the Link API
import Link from 'next/Link';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

const linkStyle = {
  fontSize: '15px',
  marginTop: '0px',
  color: 'ghostwhite',
};

const navStyle = {
  backgroundColor: 'slategrey'
};

export default () => (
            <Navbar style={navStyle} >
            <Link href='/'>
              <Nav.Link as='a' href='/' style={linkStyle} >
                 HOME
              </Nav.Link>
            </Link>
            <Link href='/about'>
              <Nav.Link as='a' href='/about' style={linkStyle} >
                 ABOUT
              </Nav.Link>
            </Link>
            <h3 style={{ marginTop: '5.5px',  }} >REST COUNTRIES API</h3>
        </Navbar>
);
